import React from "react";
import '../Components/Cover.css'
import video from "../media/video.mp4";
import './Cover.css'
const Cover = () => {
  return (
    <div className="cover-container">
      <video autoPlay loop>
        <source src="{video}" type="video/mp4"/>
      </video>
    </div>
  );
};

export default Cover;
